import React, { useState, useEffect } from 'react';
import { connect } from 'react-redux';

import { fetchBuilding, changePhaseTo } from './../../actions'
import data from './buildings.json';

const Building = (props) => {
    const [f_building, setF_building] = useState([]);

    useEffect(() => {
        setF_building( fetchBuilding(data.Well) );

        ;
    }, [])
    
    return(
        <div>
            {props.title}
        </div>
    )
}
const mapStateToProps = (state) => {
    return {
        phase: state.phase
    }
};

export default connect(mapStateToProps, { fetchBuilding, changePhaseTo })(Building);
